import React from 'react';

import styles from './AboutMe.module.css';

function AboutMe(props) {
    return(
        <div className={styles['about-div']}>
            <img alt="Me" className={styles['my-image']} src="https://media-exp1.licdn.com/dms/image/C4E03AQGji9lWkNw1yg/profile-displayphoto-shrink_800_800/0/1600437083110?e=1624492800&v=beta&t=X0KG4lXc93WGXdceUKz6lo4k0K_Y9Gu2Lo81oUZluRk"/>
            <p>Welcome to my web app. My name is Melih Ekici. I am an Industrial Engineer Graduate from METU. I like programming an generally interested in Deep Learning and Backend services. I have experience with Python programming and language with some libraries like Keras, Tensorflow, Selenium and Flask. I also have some experience with JavaScript and React. Other than these, i sometimes use Java a little to be able to run my image classification models in mobile devices.</p>
        </div>
    );
};

export default AboutMe;
